import React from 'react'


const Table = (props)=>{
    console.log('Hey')
    console.log(props)
    console.log()
    // props.props.THead.map((heading , index) => {
    //     console.log(heading)
    //     <th>{heading}</th>
    // })
    return(
        <div>
            <p>GGGGG</p>
            <div className="z-depth-4">
                <table className="responsive-table centered bordered">
                    <thead>
                        <tr>
                            {
                              props.props.THead.map((heading , index) => {
                                return(
                                    <th>{heading}</th>
                                )
                            })  
                            }
                            <th>{props.props.THead[0]}</th>
                        </tr>
                    </thead>
                </table>
            </div>
        <div/>
        </div>
    )
}

export default Table
